[backend]
precision = double
rank-allocator = linear

[constants]
gamma = 1.4
; mu = 0.00195803989154981 ; 0.004732863826479692
mu = 0.004732863826479692
Pr = 0.72
M = 0.2

[solver-time-integrator]
scheme = rk45
controller = pi
atol = 1e-5
rtol = 1e-5
dt = 0.0001
tstart = 0
tend = 2000
formulation = std
dt-min = 1e-12
dt-max = 100.0
errest-norm = l2
pi-alpha = 0.7
pi-beta = 0.4
safety-fact = 0.8
max-fact = 2.5
min-fact = 0.3

[solver]
system = navier-stokes
order = 2
anti-alias = none
shock-capturing = none
viscosity-correction = none

[solver-interfaces-line]
flux-pts = gauss-legendre

[solver-interfaces]
riemann-solver = rusanov
ldg-beta = 0.5
ldg-tau = 0.1

[solver-elements-quad]
soln-pts = gauss-legendre

[soln-plugin-writer]
dt-out = 1
basedir = .
basename = cyl-2d-p2-{n:03d}

[soln-plugin-residual]
nsteps = 1500
file = residual.csv
header = true

[soln-plugin-controller]
nsteps = 1500 ; number of solver steps between writing solution to file
savedata = 1 ; 1 to save solution data to 128x256x4 array in h5 file, 0 otherwise
setomega = 1 ; 1 to prescribe angular velocity, 0 otherwise
mpc = 0 ; 1 to select action using model predictive control, 0 otherwise
checkpoint = koopman_model.ckpt-0 ; name of neural network checkpoint file
training_path = ../training ; directory containing training scripts (change as necessary)
save_dir = sol_data ; directory in which to save solution snapshots
base_flow = base.h5 ; file containing data corresponding to steady base flow (change as necessary)
R = 2e5 ; action penalty during MPC
u_max = 0.1 ; maximum allowable control input during MPC
